//my files
function searchFormController() {
    const formsList = document.querySelectorAll('[data-js="searchForm"]')

    if(formsList.length < 1) return

    formsList.forEach(form => {
        const input = form.querySelector('[data-js="searchFormInput"]');
        const results =  form.querySelector('[data-js="searchFormResults"]');

        input.addEventListener('input', function() {
            const value = this.value

            if(value.length > 0) {
                results.classList.add('active')
            } else {
                results.classList.remove('active')
            }
        })
    })
}

document.addEventListener('DOMContentLoaded', () => {
    searchFormController();
})
function headerController() {
    const header = document.querySelector('[data-js="siteHeader"]')

    if(!header) return

    const burger = header.querySelector('[data-js="siteHeaderBurger"]')
    const burgerToggleBtn = header.querySelector('[data-js="siteHeaderBurgerBtn"]')

    if(burger && burgerToggleBtn) {
        burgerToggleBtn.addEventListener('click', function() {
            $(burger).toggleClass('active');
            $(this).toggleClass('active');
        })
    }
}

document.addEventListener('DOMContentLoaded', () => {
    headerController()
})
document.addEventListener('DOMContentLoaded', () => {
    $('img.lazyload').lazyload();
    fancyboxInit();
})

// Блокировка скролла при открытии модалок
function lockBody(onlyHeaderPadding = false) {
    let scrollbarWidth = getScrollbarWidth()

    if(!onlyHeaderPadding) {
        $('body').addClass('no-scroll');
        $('body').css('padding-right', scrollbarWidth)
    }

    $('[data-js="siteHeader"]').css('padding-right', scrollbarWidth)
}

function unlockBody() {
	$('body').removeClass('no-scroll');
    $('body').css('padding-right', 0);
    $('[data-js="siteHeader"]').css('padding-right', 0)
}

function getScrollbarWidth() {
    let div = document.createElement('div');

    div.style.overflowY = 'scroll';
    div.style.width = '50px';
    div.style.height = '50px';

    document.body.append(div);
    let scrollWidth = div.offsetWidth - div.clientWidth;

    div.remove();

    return scrollWidth
}

// инициализация фансибокса
function fancyboxInit() {
    if (typeof window.distPath == 'undefined') {
        window.distPath = '';
    }
    Fancybox.bind("[data-fancybox]", {
        placeFocusBack: false,
        mainClass: 'my-fancybox',
        idle: false,
        Carousel: {
            transition: "crossfade",
            Navigation: {
                prevTpl: `<svg><use xlink:href=${window.distPath}img/sprites/sprite.svg#arrow_classic></use></svg>`,
                nextTpl: `<svg><use xlink:href=${window.distPath}img/sprites/sprite.svg#arrow_classic></use></svg>`,
              },
        },
        Thumbs: {
            type: "classic",
        },
        Toolbar: {
            enabled: true,
            display: {
                left: [],
                middle: [],
                right: [
                  "close",
                ],
            },
        }

    });
}


